contract Benz is Car{
    string private model;
    address private owner;

    constructor(string memory _model) Car("suv", 3) { // 생성자에서 초기화 가능
        model = _model;
        owner = msg.sender;
    }

    function getModel() public view returns(string memory) {
        return model;
    }
}

